def array_equivalent(left, right, strict_nan=False):

    import numpy as np
    import pandas.api.types as pdtypes
    left, right = np.asarray(left), np.asarray(right)

    # shape compat
    if left.shape != right.shape:
        return False

    # Object arrays can contain None, NaN and NaT.
    if pdtypes.is_string_dtype(left.dtype) or pdtypes.is_string_dtype(right.dtype):

        if not strict_nan:
            return np.array_equal(left.astype('O'), right.astype('O'))

        return (left == right).all()

    # NaNs can occur in float and complex arrays.
    if pdtypes.is_float_dtype(left.dtype) or pdtypes.is_complex_dtype(left.dtype):

        # empty
        if not (np.prod(left.shape) and np.prod(right.shape)):
            return True
        return ((left == right) | (np.isnan(left) & np.isnan(right))).all()

    # numpy will not allow this type of datetimelike vs integer comparison
    if pdtypes.is_datetime64_any_dtype(left.dtype) and pdtypes.is_numeric_dtype(right.dtype):
        return False

    # if we have structured dtypes, compare first
    if left.dtype.type is np.void or right.dtype.type is np.void:
        if left.dtype != right.dtype:
            return False

    return np.array_equal(left, right)
